import { Component } from "react";

export class Form extends Component {
  constructor(props) {
    super(props);
    this.state = {
      text: ""
    };
  }

  handleChange = (e) => {
    console.log("I am here in handle change");
    this.setState({
      text: e.target.value
    });
  };

  render() {
    return (
      <div className="form">
        <input
          onSubmit={this.handleChange}
          value={this.state.text}
          placeholder="Whats on your mind?"
          required
        />
        <button>Add</button>
      </div>
    );
  }
}
